import React from "react";
import {Carousel} from '3d-react-carousal'
import Link from "next/link";

const slides = [
    <Link href={`/streaming/1`}><img  src="https://picsum.photos/800/300/?random" alt="1" /></Link> ,
    <Link href={`/streaming/1`}><img  src="https://picsum.photos/800/301/?random" alt="2" /></Link>,
    <Link href={`/streaming/1`}><img  src="https://picsum.photos/800/302/?random" alt="3" /></Link>,
    <Link href={`/streaming/1`}><img  src="https://picsum.photos/800/303/?random" alt="4" /> </Link> ,
    <Link href={`/streaming/1`}><img src="https://picsum.photos/800/304/?random" alt="5" /></Link>    ];


export default function StreamingRoomsList() {
    return (
        <Carousel slides={slides} autoplay={true} interval={2000}/>
    )
}
